import * as actionTypes from "./constant";
import axios from "axios";

export const actGetRestaurantListApi = () => {
  return (dispatch) => {
    dispatch(actGetRestaurantListRequest);
    axios({
      url: `http://localhost:5000/api/v1/restaurants`,
      method: "GET",
    })
      .then((result) => {
        dispatch(actGetRestaurantListSuccess(result.data));
      })
      .catch((error) => {
        dispatch(actGetRestaurantListFailed(error));
      });
  };
};

const actGetRestaurantListRequest = () => {
  return {
    type: actionTypes.GET_RESTAURANT_LIST_REQUEST,
  };
};

const actGetRestaurantListSuccess = (list) => {
  return {
    type: actionTypes.GET_RESTAURANT_LIST_SUCCESS,
    payload: list,
  };
};

const actGetRestaurantListFailed = (error) => {
  return {
    type: actionTypes.GET_RESTAURANT_LIST_FAILED,
    payload: error,
  };
};
